import Subcomponent from "./subcomponents/SubExample";

const SiteMap = () => {
    return (
        <div className="absolute left-10 top-20">
            <h1 className="break-normal font-semibold text-7xl text-blue-900">This is the Site Map component.</h1>
            <h1 className="break-normal font-semibold text-7xl text-blue-900">Mariam will work on this.</h1>
            <h1 className="break-normal font-semibold text-5xl text-yellow-900">The rest us will help her with any help she needs here.</h1>
            <Subcomponent />
        </div>

    );
}

export default SiteMap;
